import { Box, Card, Rating } from "@mui/material";
import React from "react";
import styled from "styled-components";
import test from "../../image/Tv.jpg"





export default function Cards
(){

    function importAll(r) {
        let images = {};
        r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
        return images;
      }

      const images = importAll(require.context('./images', false, /\.(png|jpe?g|svg)$/));

return <>
    <Card>
        <Box component={"section"}>
            <Box>
            <Rating name="half-rating-read" defaultValue={2.7} precision={0.5} readOnly />

            <Box component={"img"} src="../../image/Tv.jpg"
            sx={{width:100,height:100,position:"relative",zIndex:"-1"}}></Box>
            </Box>
            {/* <img src={test} style={{width:'100px',height:"100px"}}> */}
            <img src={`url(${"../../image/Tv.jpg"})`} style={{width:'100px',height:"100px"}}>
            </img>

        </Box>


    </Card>


    </>
}
